webpackJsonp([80],{621:function(n,i){n.exports="# 贡献代码\n\n## 开发\n\n**复制项目：**\n\n```bash\ngit clone ssh://git@git.palife.com:2222/PA-H5/key-ui.git\n```\n\n**安装依赖：**\n\n```bash\nnpm i --save-dev key-utils --registry=http://npmjs.palife.com:7001\nnpm i\n```\n\n**进入开发模式：**\n\n```bash\nnpm start\n```\n\n**检查代码：**\n\n```bash\nnpm run lint\n```\n\n**测试：**\n\n```bash\nnpm test\n```\n\n## Build\n\n- 独立 build 组件：`npm run build:lib`\n- 整体 build 组件库：`npm run build:lib-int`\n- 整体 build 组件库，抽离 CSS：`npm run build:css`\n- 发布前面三种形式：`npm run build`\n\n如果需要 build `viewport-mulitply-2.css` 主题的组件库，可以在上面四个命令后各加 `:vp2` 后缀，比如 `npm run build:lib:vp2`\n\n- build 所有：`npm run build:all`\n- build 演示网站：`npm run build:site`\n- 发布演示网站：`npm run pub:site`\n- 发布到 `http://npmjs.palife.com:7001`: `npm run release`\n\n## 编码规范\n\nKeyUI 中的组件必须是：\n\n- 抽象的\n- 与业务无关的\n- 与数据管理（比如Flux / Redux）无关的\n\n编码规范请阅读[React最佳实践](https://github.com/PALifeH5/docs/blob/master/react-best-practices/React%E6%9C%80%E4%BD%B3%E5%AE%9E%E8%B7%B5.md)。\n"}});